import './App.css'
import NavbarMain from './components/NavbarMain';
import LoginUserField from './components/LoginUserField';
import LoginPasswordField from './components/LoginPasswordField';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <NavbarMain />
      </header>
      <div className="main-content">
        <h1 className="main-content--title">KeepItSafe</h1>
        <LoginUserField />
        <LoginPasswordField />
      </div>
    </div>
  );
}

export default App;
